import React, { useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import * as ROUTES from "../constants/routes.js";

import BirdyLogo from "../atomComponents/Birdy-logo.js";
import "../stylesheets/signup.css";

export default function Signup(){
    useEffect( () => {
        document.title = "Sign Up - Birdy";
    },[]);

    return(
        <main className="signup-main column gap20">
            <div className="signup-form-container column gap20">
                <BirdyLogo />
                <form className="signup-form column">
                    <input
                        className="signup-form-input" 
                        type="email" 
                        placeholder="Email address" 
                        aria-label="Enter your email address"
                        name="emailAddress"
                    />
                    <input
                        className="signup-form-input" 
                        type="password" 
                        placeholder="Password" 
                        aria-label="Enter your password"
                        name="password"                      
                    />
                    <input 
                        className={`signup-form-submit`}
                        type="submit" 
                        value="Log In"
                    />
                </form>
            </div>
            <div className="signup-have-account">
                <p>
                    Don't have an account?&ensp;
                    <Link className="signup-ref-login" to={ROUTES.LOGIN}>
                        Sign up
                    </Link>
                </p>
            </div>
        </main>
    )
};
